import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Box,
  Card,
  CardContent,
  CardMedia,
  IconButton,
  Button,
  TextField,
  Divider,
  Paper
} from '@mui/material';
import { Add, Remove, Delete, ReceiptLong } from '@mui/icons-material';
import ReservationService from '../services/ReservationService';

const ReservationSummaryPage = () => {
  const navigate = useNavigate();
  const [items, setItems] = useState(ReservationService.getItems());

  useEffect(() => {
    const handler = () => setItems(ReservationService.getItems());
    window.addEventListener('reservationUpdated', handler);
    return () => window.removeEventListener('reservationUpdated', handler);
  }, []);

  const updateQty = (id, qty) => ReservationService.updateQuantity(id, qty);
  const removeItem = (id) => ReservationService.removeItem(id);

  const subtotal = ReservationService.getSubtotal();

  return (
    <Container maxWidth="md">
      <Typography variant="h4" gutterBottom sx={{ fontWeight: 'bold', mb: 3 }}>
        Reservation Summary
      </Typography>

      {items.length === 0 ? (
        <Box textAlign="center" sx={{ py: 6 }}>
          <Typography color="text.secondary" sx={{ mb: 2 }}>No items selected.</Typography>
          <Button variant="contained" onClick={() => navigate('/')}>Browse Products</Button>
        </Box>
      ) : (
        <Box>
          {items.map((item) => (
            <Card key={item.id} sx={{ mb: 2, backgroundColor: '#212121', color: 'white', borderRadius: '16px', boxShadow: '0 10px 20px rgba(0, 0, 0, 0.3), 0 5px 30px rgba(255, 193, 7, 0.1)' }}>
              <CardContent>
                <Box display="flex" alignItems="center">
                  <CardMedia
                    component="img"
                    sx={{ width: 80, height: 80, objectFit: 'cover', borderRadius: 1, ml: 1 }}
                    image={item.imagePath}
                    alt={item.name}
                    onError={(e) => {
                      e.target.src = 'https://via.placeholder.com/80x80?text=No+Image';
                    }}
                  />

                  <Box sx={{ flex: 1, ml: 2 }}>
                    <Typography variant="h6" sx={{ fontWeight: 600, color: 'white' }}>{item.name}</Typography>
                    <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#FFC107' }}>{item.price}</Typography>
                  </Box>

                  <Box display="flex" alignItems="center" sx={{ mx: 2 }}>
                    <IconButton onClick={() => updateQty(item.id, (item.qty || 1) - 1)} disabled={(item.qty || 1) <= 1}>
                      <Remove />
                    </IconButton>
                    <TextField
                      value={item.qty || 1}
                      onChange={(e) => {
                        const value = parseInt(e.target.value) || 1;
                        updateQty(item.id, value);
                      }}
                      inputProps={{ style: { textAlign: 'center', width: '50px' }, min: 1 }}
                      variant="outlined"
                      size="small"
                    />
                    <IconButton onClick={() => updateQty(item.id, (item.qty || 1) + 1)}>
                      <Add />
                    </IconButton>
                  </Box>

                  <Typography variant="h6" sx={{ fontWeight: 'bold', minWidth: '80px', textAlign: 'right', color: 'white' }}>
                    â‚±{(parseFloat(String(item.price).replace('â‚±', '').replace(/,/g, '')) * (item.qty || 1)).toFixed(2)}
                  </Typography>

                  <IconButton onClick={() => removeItem(item.id)} color="error" sx={{ ml: 1 }}>
                    <Delete />
                  </IconButton>
                </Box>
              </CardContent>
            </Card>
          ))}

          <Paper elevation={2} sx={{ p: 3, mt: 3, backgroundColor: '#212121', color: 'white', borderRadius: '16px', boxShadow: '0 10px 20px rgba(0, 0, 0, 0.3), 0 5px 30px rgba(255, 193, 7, 0.1)' }}>
            <Typography variant="h6" gutterBottom sx={{ color: 'white' }}>Summary</Typography>
            <Divider sx={{ mb: 2 }} />

            <Box display="flex" justifyContent="space-between" sx={{ mb: 2 }}>
              <Typography sx={{ color: 'white' }}>Subtotal</Typography>
              <Typography sx={{ color: 'white' }}>â‚±{subtotal.toFixed(2)}</Typography>
            </Box>

            <Box display="flex" gap={2} sx={{ mb: 2 }}>
              <Button
                variant="outlined"
                onClick={() => navigate('/')}
              sx={{ borderColor: '#FFC107', color: '#FFC107' }}
              >
                Continue Browsing
              </Button>
            </Box>

            <Button
              fullWidth
              variant="contained"
              size="large"
              startIcon={<ReceiptLong />}
              onClick={() => navigate('/reservation/receipt', {
                state: { items, subtotal, deliveryFee: 0, total: subtotal }
              })}
              sx={{ py: 1.5, background: 'linear-gradient(90deg, #FFC107 0%, #FF9800 100%)', color: 'white', '&:hover': { background: 'linear-gradient(90deg, #FFB300 0%, #F57C00 100%)' } }}
            >
              Confirm Reservation
            </Button>
          </Paper>
        </Box>
      )}
    </Container>
  );
};

export default ReservationSummaryPage;
